Colonel Sir Horace Beauchamp Seymour KCH (22 November 1791 – 23 November 1851) was a Peelite Member of Parliament for Lisburn 1819–26, Orford (1820), Bodmin (1826–32), Midhurst (1841–45), Antrim (1845–47), and Lisburn 1847–51. He was an ancestor of Diana, Princess of Wales. Horace Seymour was the son of Admiral Lord Hugh Seymour (son of Francis Seymour-Conway, 1st Marquess of Hertford) and Lady Anne Horatia Waldegrave. He married, firstly, Elizabeth Malet Palk, daughter of Sir Lawrence Palk, 2nd Baronet and granddaughter of Sir Robert Palk, on 15 May 1818. He married, secondly, Frances Selina Isabella Poyntz, daughter of William Stephen Poyntz and Hon. Elizabeth Mary Browne, in July 1835. By his first wife he had three children;
Horatio Walpole, 4th Earl of Orford( 24 September 1717 – 2 March 1797), also known as Horace Walpole, was an English writer, art historian, man of letters, antiquarian and Whig politician. He had Strawberry Hill House built in Twickenham, south- west London, reviving the Gothic style some decades before his Victorian successors. His literary reputation rests on the first Gothic novel," The Castle of Otranto"( 1764), and his" Letters", which are of significant social and political interest. They have been published by Yale University Press in 48 volumes. He was the son of the first British Prime Minister, Sir Robert Walpole. As Horace Walpole was childless, on his death his barony of Walpole descended to his cousin of the same surname, who was created the new Earl of Orford.
Lord George Seymour- Conway( 21 July 1763 – 10 March 1848), known as Lord George Seymour, was a British politician. A member of the Seymour family headed by the Duke of Somerset, Seymour was the seventh son and youngest child of Francis Seymour- Conway, 1st Marquess of Hertford, and Lady Isabella, daughter of Charles FitzRoy, 2nd Duke of Grafton. He was the brother of Francis Ingram- Seymour- Conway, 2nd Marquess of Hertford, Lord Henry Seymour, Lord Robert Seymour, Lord Hugh Seymour and Lord William Seymour. He was returned to the Parliament of Great Britain as one of two representatives for Orford in 1784, a seat he held until 1790. He later represented Totnes between 1796 and 1801. Seymour married Isabella, daughter of Reverend the Honourable George Hamilton, in 1795. Their son Sir George Hamilton Seymour was a diplomat. Seymour died on 10 March 1848, aged 84, and is buried in St. Andrew's Church, Waterloo Street Hove in Sussex
